sys_variable_value.value:
(function execute(inputs, outputs) {

  var payloadJSON = JSON.parse(inputs.payload);
  payloadJSON.extra_vars.snow_instance = gs.getProperty('instance_name');
  payloadJSON.extra_vars.ctask_sys_id = inputs.sysID.toString();
  payloadJSON.extra_vars.callback_url = "https://"+gs.getProperty('instance_name')+".service-now.com/api/now/table/sc_task/"+inputs.sysID.toString();
  outputs.payload1 = JSON.stringify(payloadJSON);

})(inputs, outputs);

